import React from "react";
import { Box, Typography, Card, CardContent, CardMedia } from "@mui/material";
import Image1 from "../assets/image1.png"; // Adjust the path if necessary

const MissPoppins: React.FC = () => {
    return (
        <Box
            sx={{
                backgroundColor: "#FFEEEE", // Light pink background
                minHeight: "100vh",
                padding: "4rem 2rem",
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                gap: "2rem",
            }}
        >
            {/* Page Title */}
            <Typography
                variant="h4"
                sx={{
                    color: "#4A2040", // Dark purple
                    fontWeight: "bold",
                    marginBottom: "2rem",
                }}
            >
                MissPoppins App Redesign
            </Typography>

            {/* Overview Section */}
            <Box
                sx={{
                    display: "flex",
                    flexDirection: { xs: "column", md: "row" },
                    alignItems: "center",
                    justifyContent: "center",
                    backgroundColor: "#FFFFFF",
                    padding: "2rem",
                    borderRadius: "16px",
                    boxShadow: "0px 8px 16px rgba(0, 0, 0, 0.1)",
                    maxWidth: "900px",
                    width: "100%",
                    gap: "2rem",
                }}
            >
                {/* Image Section */}
                <CardMedia
                    component="img"
                    image={Image1}
                    alt="MissPoppins App Mockup"
                    sx={{
                        maxWidth: "300px",
                        borderRadius: "16px", // Rounded corners
                    }}
                />

                {/* Text Section */}
                <CardContent
                    sx={{
                        flex: 1,
                        display: "flex",
                        flexDirection: "column",
                        gap: "1rem",
                    }}
                >
                    <Typography
                        variant="h6"
                        sx={{
                            color: "#4A2040", // Dark purple
                            fontWeight: "bold",
                        }}
                    >
                        Overview:
                    </Typography>
                    <Typography
                        variant="body1"
                        sx={{
                            color: "#4A2040",
                            lineHeight: 1.6,
                        }}
                    >
                        MissPoppins is a redesign project aimed at simplifying
                        navigation and improving the user experience for coach-client
                        interactions. By introducing strategic pricing and streamlined
                        workflows, the redesign enhances usability and client satisfaction.
                    </Typography>
                </CardContent>
            </Box>

            {/* Additional Details */}
            <Box
                sx={{
                    marginTop: "2rem",
                    maxWidth: "900px",
                    width: "100%",
                    textAlign: "left",
                }}
            >
                <Typography
                    variant="h5"
                    sx={{
                        color: "#4A2040",
                        fontWeight: "bold",
                        marginBottom: "1rem",
                    }}
                >
                    Key Features:
                </Typography>
                <Typography
                    variant="body1"
                    sx={{
                        color: "#4A2040",
                        lineHeight: 1.6,
                    }}
                >
                    - Streamlined navigation for easy appointment scheduling.
                    <br />
                    - Improved pricing strategy for better customer understanding.
                    <br />
                    - A user-friendly interface with enhanced accessibility.
                </Typography>
            </Box>
        </Box>
    );
};

export default MissPoppins;
